CREATE TABLE mytable(
   id       INTEGER  NOT NULL PRIMARY KEY 
  ,type     VARCHAR(12) NOT NULL
  ,province VARCHAR(17)
  ,city     VARCHAR(38)
  ,address  VARCHAR(85)
  ,img_url  VARCHAR(77)
  ,value    VARCHAR(200)
  ,owner    VARCHAR(255)
  ,name     VARCHAR(51)
  ,page     INTEGER 
  ,prov_id  INTEGER 
);
